INSERT INTO `provaitemopcao` (`provaitemopcao`, `provaitem`, `descricao`, `letra`) VALUES
(90, 17, '<div style="font-family: ''Times New Roman''; font-size: medium;">assegura-se ao consumidor a revisão de dispositivos contratuais que venham a tornar as prestações muito elevadas.</div>', 'A'),
(91, 17, '<div style="font-family: ''Times New Roman''; font-size: medium;">toda e qualquer cláusula contratual poderá ser revista a qualquer momento pelo consumidor.</div>', 'B'),
(92, 17, '<div style="font-family: ''Times New Roman''; font-size: medium;">assegura-se ao fornecedor o direito de cancelar a venda de produtos e serviços, em razão do aumento de seus custos.</div>', 'C'),
(93, 17, '<div style="font-family: ''Times New Roman''; font-size: medium;">garante-se ao fornecedor dos produtos e serviços, caso julgue necessário, o direito de rever os valores das prestações</div>', 'D'),
(94, 17, '<span style="font-family: ''Times New Roman''; font-size: medium;">toda e qualquer cláusula contratual apenas poderá ser revista com o consentimento do fornecedor dos produtos e serviços.</span>', 'E'),
(95, 16, '<div><span style="font-size: 13.3333px; font-family: Arial, Verdana;">a produtos ou serviços de qualquer tipo e origem.</span></div>', 'A'),
(96, 16, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">apenas a produtos perecíveis, nacionais ou importados.</span></font></div>', 'B'),
(97, 16, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">apenas a aparelhos e utensílios produzidos no país.</span></font></div>', 'C'),
(98, 16, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">somente a produtos importados de países desenvolvidos.</span></font></div>', 'D'),
(99, 16, '<span style="font-size: 13.3333px;">exclusivamente a serviços prestados por empresas nacionais.</span>', 'E'),
(100, 18, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">não permitem que fornecedores internacionais de produtos e serviços sejam penalizados.</span></font></div>', 'A'),
(101, 18, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">não implicam a perda de outros estipulados em tratados internacionais ou na legislação interna do país.</span></font></div>', 'B'),
(102, 18, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">perdem o efeito diante de leis ou tratados internacionais sobre consumo.</span></font></div>', 'C'),
(103, 18, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">podem ser anulados a qualquer tempo por decisão unilateral do governo federal.</span></font></div>', 'D'),
(104, 18, '<span style="font-size: 13.3333px;">são válidos mesmo que infrinjam os princípios gerais que norteiam o direito.</span>', 'E'),
(105, 19, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">apenas a primeira ocorrência está correta.</span></font></div>', 'A'),
(106, 19, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">apenas a segunda ocorrência está correta.</span></font></div>', 'B'),
(107, 19, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">as duas ocorrências são aceitáveis, mas não corretas.</span></font></div>', 'C'),
(108, 19, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">as duas ocorrências estão incorretas.</span></font></div>', 'D'),
(109, 19, '<span style="font-size: 13.3333px;">as duas ocorrências estão corretas.</span>', 'E'),
(110, 20, '<div><font face="Arial, Verdana"><span style="font-size: 13.3333px;">a relação direta com o acontecimento.</span></font></div>', 'A'),
(111, 20, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">a interpretação do acontecimento.</span></font></div>', 'B'),
(112, 20, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">a necessidade de noticiar de acordo com a filosofia do jornal.</span></font></div>', 'C'),
(113, 20, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">o desejo de informar realisticamente sobre o ocorrido.</span></font></div>', 'D'),
(114, 20, '<span style="font-size: 13.3333px;">o objetivo de questionar as causas sociais dos fatos.</span>', 'E'),
(115, 21, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">o julgamento dos leitores.</span></font></div>', 'A'),
(116, 21, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">a opinião do repórter.</span></font></div>', 'B'),
(117, 21, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">a crítica a um fato político.</span></font></div>', 'C'),
(118, 21, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">a resposta a outros veículos de comunicação.</span></font></div>', 'D'),
(119, 21, '<span style="font-size: 13.3333px;">o ponto de vista da empresa jornalística.</span>', 'E'),
(120, 22, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">desprezo aos acontecimentos da atualidade.</span></font></div>', 'A'),
(121, 22, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">obediência à constituição e às leis do país.</span></font></div>', 'B'),
(122, 22, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">ausência de ideologia nas manifestações de opinião.</span></font></div>', 'C'),
(123, 22, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">opiniões assumidas como verdadeiras e imutáveis.</span></font></div>', 'D'),
(124, 22, '<span style="font-size: 13.3333px;">conjunto de verdades religiosas.</span>', 'E'),
(125, 23, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">juízos de valor.</span></font></div>', 'A'),
(126, 23, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">anedotário popular.</span></font></div>', 'B'),
(127, 23, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">fatos pessoais.</span></font></div>', 'C'),
