(170, 32, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">não causa impactos na região, uma vez que a quantidade total de água da Terra permanece constante.</span></font></div>', 'A'),
(171, 32, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">não causa impactos na região, uma vez que a água que alimenta a represa prossegue depois rio abaixo com a mesma vazão e velocidade.</span></font></div>', 'B'),
(172, 32, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">aumenta a velocidade dos rios, acelerando o ciclo da água na região.</span></font></div>', 'C'),
(173, 32, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">aumenta a evaporação na região da represa, acompanhada também por um aumento local da umidade relativa do ar.</span></font></div>', 'D'),
(174, 32, '<span style="font-size: 13.3333px;">diminui a quantidade de água disponível para a realização do ciclo da água.</span>', 'E'),
(175, 33, '<div><font face="Arial, Verdana"><span style="font-size: 13.3333px;">sublima outros metais presentes na lata.</span></font></div>', 'A'),
(176, 33, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">evapora substâncias radioativas remanescentes.&nbsp;</span></font></div>', 'B'),
(177, 33, '<div><span style="font-size: 13.3333px; font-family: Arial, Verdana;">impede que o alumínio seja eliminado em altas temperaturas.</span></div>', 'C'),
(178, 33, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">desmagnetiza as latas que passaram pelo processo de triagem.&nbsp;</span></font></div>', 'D'),
(179, 33, '<span style="font-size: 13.3333px;">queima os resíduos de tinta e outras substâncias presentes na lata.</span>', 'E'),
(180, 34, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">física, física e química.</span></font></div>', 'A'),
(181, 34, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">física, química e química.</span></font></div>', 'B'),
(182, 34, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">química, física e física.&nbsp;</span></font></div>', 'C'),
(183, 34, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">química, física e química.</span></font></div>', 'D'),
(184, 34, '<span style="font-size: 13.3333px;">química, química e física.</span>', 'E'),
(185, 35, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">A matéria é constituída por átomos que não podem ser decompostos, ou seja, são indestrutíveis e maciços.</span></font></div><div><font face="Arial, Verdana"><span style="font-size: 13.3333px;"><br></span></font></div>', 'A'),
(186, 35, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">Todos os átomos do mesmo elemento são idênticos e apresentam a mesma massa e forma.</span></font></div>', 'B'),
(187, 35, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">Os compostos são formados por um número fixo de átomos de seus elementos constituintes.</span></font></div>', 'C'),
(188, 35, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">Se existir mais de um composto formado por dois elementos diferentes, os números dos átomos de cada elemento nos compostos guardam entre si uma razão de números inteiros.</span></font></div>', 'D'),
(189, 35, '<span style="font-size: 13.3333px;">As interações entre átomos de hidrogênio e oxigênio para formar água ocorrem na razão de um para um, obedecendo assim à chamada “regra da máxima simplicidade”.</span>', 'E'),
(190, 36, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">na combustão, que gera gases quentes para mover os pistões no motor.</span></font></div>', 'A'),
(191, 36, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">nos eixos, que transferem torque às rodas e impulsionam o veículo.</span></font></div>', 'B'),
(192, 36, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">na ignição, quando a energia elétrica é convertida em trabalho.</span></font></div>', 'C'),
(193, 36, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">na exaustão, quando gases quentes são expelidos para trás.</span></font></div>', 'D'),
(194, 36, '<span style="font-size: 13.3333px;">na carburação, com a difusão do combustível no ar.</span>', 'E'),
(195, 37, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">&nbsp;I e II.</span></font></div>', 'A'),
(196, 37, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">II e III.</span></font></div>', 'B'),
(197, 37, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">II e IV.</span></font></div>', 'C'),
(198, 37, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">I, II e IV.</span></font></div>', 'D'),
(199, 37, '<span style="font-size: 13.3333px;">II, III e IV.</span>', 'E'),
(200, 38, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">Temperatura, superfície de contato e concentração.</span></font></div>', 'A'),
(201, 38, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">Concentração, superfície de contato e catalisadores.</span></font></div>', 'B'),
(202, 38, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">Temperatura, superfície de contado e catalisadores.</span></font></div>', 'C'),
(203, 38, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">Superfície de contato, temperatura e concentração.</span></font></div>', 'D'),
(204, 38, '<span style="font-size: 13.3333px;">Temperatura, concentração e catalisadores.</span>', 'E'),
(205, 39, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">Separação mecânica, extração, decantação.</span></font></div>', 'A'),
(206, 39, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">Separação magnética, combustão, filtração.</span></font></div>', 'B'),
(207, 39, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">Separação magnética, extração, filtração.</span></font></div>', 'C'),
(208, 39, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">Imantação, combustão, peneiração.</span></font></div>', 'D'),
(209, 39, '<span style="font-size: 13.3333px;">Imantação, destilação, filtração.</span>', 'E'),
(210, 40, '<div><span style="font-size: 13.3333px; font-family: Arial, Verdana;">valor numérico, desvio e unidade.</span></div>', 'A'),
(211, 40, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">valor numérico, desvio, unidade e sentido.</span></font></div>', 'B'),
(212, 40, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">desvio, direção, sentido e unidade.</span></font></div>', 'C'),
(213, 40, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">valor numérico, unidade, direção e sentido.</span></font></div>', 'D'),
(214, 40, '<span style="font-size: 13.3333px;">valor numérico, direção e unidade.</span>', 'E'),
(215, 41, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">o solo exerce sobre o cavalo.</span></font></div>', 'A'),
(216, 41, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">ele exerce sobre a charrete.&nbsp;</span></font></div>', 'B'),
(217, 41, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">a charrete exerce sobre ele.</span></font></div>', 'C'),
(218, 41, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">a charrete exerce sobre o solo.</span></font></div>', 'D'),
(219, 41, '<span style="font-size: 13.3333px;">a força peso.</span>', 'E'),
(230, 44, '<div><font face="Arial, Verdana"><span style="font-size: 13.3333px;">Princípio da Conservação da Energia Mecânica.</span></font></div>', 'A'),
(231, 44, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">Propriedade geral da matéria, denominada inércia.</span></font></div>', 'B'),
(232, 44, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">Princípio da Conservação da Quantidade de Movimento.</span></font></div>', 'C'),
(233, 44, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">Segunda Lei de Newton.</span></font></div>', 'D'),
(234, 44, '<span style="font-size: 13.3333px;">Princípio da Independência dos Movimentos.</span>', 'E'),
(240, 45, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">um tenista jogar a bola bem alto para dar um saque e tentar o ace.</span></font></div>', 'A'),
(241, 45, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">um boxeador girar o tronco para desferir um golpe com mais potência.</span></font></div>', 'B'),
(242, 45, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">um nadador puxar o máximo de água para trás a fim de ganhar propulsão.</span></font></div>', 'C'),
(243, 45, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">um jogador de basquete pular ao fazer um arremesso de 3 pontos.</span></font></div>', 'D'),
(244, 45, '<span style="font-size: 13.3333px;">o jogador de futebol tomar distância para bater uma falta com mais força.</span>', 'E'),
(245, 46, '<div><font face="Arial, Verdana"><span style="font-size: 13.3333px;">carroça – semana</span></font></div>', 'A'),
(246, 46, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">carro – dia</span></font></div>', 'B'),
(247, 46, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">caminhada – hora</span></font></div>', 'C'),
(248, 46, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">bicicleta – minuto</span></font></div>', 'D'),
(249, 46, '<span style="font-size: 13.3333px;">avião – segundo</span>', 'E'),
(250, 47, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">distância.</span></font></div>', 'A'),
(251, 47, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">aceleração.</span></font></div>', 'B'),
(252, 47, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">velocidade.</span></font></div>', 'C'),
(253, 47, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">tempo.</span></font></div>', 'D'),
(254, 47, '<span style="font-size: 13.3333px;">luminosidade.</span>', 'E'),
(255, 48, '<div><font face="Arial, Verdana"><span style="font-size: 13.3333px;">o aluno que está sentado na poltrona, acompanha o ônibus, portanto também se afasta do ponto de ônibus.</span></font></div>', 'A'),
(256, 48, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">podemos dizer que um corpo está em movimento em relação a um referencial quando a sua posição muda em relação a esse referencial.</span></font></div>', 'B'),
(257, 48, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">o aluno está parado em relação ao ônibus e em movimento em relação ao ponto de ônibus, se o referencial for o próprio ônibus.</span></font></div>', 'C'),
(258, 48, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">neste exemplo, o referencial adotado é o ônibus.</span></font></div>', 'D'),
(259, 48, '<span style="font-size: 13.3333px;">para dizer se um corpo está parado ou em movimento, precisamos relacioná-lo a um ponto ou a um conjunto de pontos de referência.</span>', 'E'),
(260, 49, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">no efeito relativístico do movimento de rotação da terra.</span></font></div>', 'A'),
(261, 49, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">no princípio de que todo corpo que possui massa sofre os efeitos do princípio da inércia.</span></font></div>', 'B'),
(262, 49, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">nas leis da termodinâmica, devido a uma redução de pressão na superfície da terra, resultado da ausência instantânea do movimento.</span></font></div>', 'C'),
(263, 49, '<div style="font-family: ''Times New Roman''; font-size: medium;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;">no fato de que a terra, no momento da parada, passaria repelir os corpos devido à ação gravitacional.</span></font></div>', 'D'),
(264, 49, '<span style="font-size: 13.3333px;">no princípio da conservação da energia mecânica, pois a resistência do ar deixaria de atuar e a normal sobre cada corpo seria igual a zero.</span>', 'E'),
