(190, 'theme_mods_zerif-lite', 'a:51:{i:0;b:0;s:10:"zerif_logo";s:97:"http://rumoauniversidade.ufop.br/wp-content/uploads/2016/06/1_Primary_logo_on_transparent_512.png";s:15:"zerif_copyright";s:34:"Universidade Federal de Ouro Preto";s:22:"zerif_socials_facebook";s:34:"#www.facebook.com/prevest.ufop.mjm";s:21:"zerif_socials_twitter";s:0:"";s:22:"zerif_socials_linkedin";s:0:"";s:21:"zerif_socials_behance";s:0:"";s:22:"zerif_socials_dribbble";s:0:"";s:13:"zerif_address";s:63:"R. Trinta e Seis, 115 - Loanda, João Monlevade - MG, 35931-008";s:11:"zerif_email";s:53:"<a href="mailto:rumo.ufop@gmail.com">Fale conosco</a>";s:11:"zerif_phone";s:43:"<a href="tel:3138528709">(31) 3852-8709</a>";s:20:"zerif_bigtitle_title";s:39:"Pré - Vestibular: Rumo à universidade";s:28:"zerif_contactus_button_label";s:15:"Enviar Mensagem";s:21:"zerif_contactus_email";s:19:"rumo.ufop@gmail.com";s:30:"zerif_contactus_recaptcha_show";i:0;s:23:"zerif_contactus_sitekey";s:0:"";s:25:"zerif_contactus_secretkey";s:0:"";s:19:"zerif_bigtitle_show";b:0;s:30:"zerif_bigtitle_redbutton_label";s:34:"Universidade federal de ouro preto";s:28:"zerif_bigtitle_redbutton_url";s:25:"http://www.ufop.br/#focus";s:32:"zerif_bigtitle_greenbutton_label";s:29:"Prefeitura de João Monlevade";s:30:"zerif_bigtitle_greenbutton_url";s:33:"http://www.pmjm.mg.gov.br//#focus";s:20:"zerif_ourfocus_title";s:10:"Nossa base";s:23:"zerif_ourfocus_subtitle";s:59:"Uma parceria entre a UFOP e a Prefeitura de João Monlevade";s:17:"background_repeat";s:6:"repeat";s:21:"background_position_x";s:6:"center";s:22:"zerif_aboutus_subtitle";s:39:"Pré - Vestibular: Rumo à Universidade";s:26:"zerif_aboutus_biglefttitle";s:18:"Qualidade e Ensino";s:18:"zerif_aboutus_text";s:759:"O Curso Pré-Vestibular: Rumo à Universidade oferecido pelo Instituto de Ciências Exatas e Aplicadas (ICEA) da Universidade Federal de Ouro Preto (UFOP) com apoio da Pró-Reitoria de Assuntos Comunitários e Estudantis (PRACE/UFOP) e em parceria com a prefeitura de João Monlevade (PMJM) é um curso gratuito, sendo oferecidas as disciplinas: <br /><br /> Português, Redação, Matemática, Física, Química, Biologia, História, Geografia e Inglês. As aulas ocorrem no ICEA/UFOP ou em outro local, caso haja necessidade, de segunda-feira a sexta-feira das 18h10 às 22h25 e em alguns sábados para reposição de aulas ou aplicação de simulados. As aulas são ministradas pelos estudantes do ICEA/UFOP e pelos professores da rede municipal de ensino.";s:28:"zerif_aboutus_feature1_title";s:17:"Processo seletivo";s:27:"zerif_aboutus_feature1_text";s:24:"Entre Dezembro e Janeiro";s:25:"zerif_aboutus_feature1_nr";i:100;s:28:"zerif_aboutus_feature2_title";s:12:"1º Semestre";s:27:"zerif_aboutus_feature2_text";s:20:"De Março até Junho";s:25:"zerif_aboutus_feature2_nr";i:50;s:28:"zerif_aboutus_feature3_title";s:17:"Processo seletivo";s:27:"zerif_aboutus_feature3_text";s:20:"Entre Junho e Agosto";s:25:"zerif_aboutus_feature3_nr";i:100;s:28:"zerif_aboutus_feature4_title";s:12:"2º semestre";s:27:"zerif_aboutus_feature4_text";s:23:"De Agosto até Novembro";s:25:"zerif_aboutus_feature4_nr";i:50;s:18:"zerif_ourteam_show";b:0;s:23:"zerif_testimonials_show";b:1;s:34:"zerif_testimonials_pinterest_style";b:1;s:21:"zerif_latestnews_show";b:1;s:16:"background_image";s:67:"http://rumoauniversidade.ufop.br/wp-content/uploads/2016/06/bcg.jpg";s:21:"background_attachment";s:5:"fixed";s:18:"nav_menu_locations";a:1:{s:7:"primary";i:2;}s:19:"zerif_ourteam_title";s:14:"Nosso objetivo";s:22:"zerif_ourteam_subtitle";s:0:"";s:18:"custom_css_post_id";i:-1;}', 'yes'),
