(54, 1, '2016-07-01 13:51:31', '2016-07-01 16:51:31', '<h1><strong>Inscrições Abertas para o Processo Seletivo do Curso Pré-Vestibular: Rumo à Universidade - 2º Semestre de 2016</strong></h1>\r\nO Instituto de Ciências Exatas e Aplicadas (ICEA) da Universidade Federal de Ouro Preto (UFOP) com apoio da Pró-Reitoria de Assuntos Acadêmicos e Estudantis e em parceria com a Prefeitura de João Monlevade oferecerá no segundo semestre de 2016 um curso pré-vestibular gratuito. O Curso oferecerá as disciplinas de Português, Redação, Matemática, Química, Física, Biologia, Geografia, História e Língua Estrangeira.\r\n\r\nO <strong>período de inscrições</strong> para o Processo Seletivo do curso Pré-Vestibular Rumo à Universidade será entre os dias <strong>04/07/2016 e</strong><strong> 21/07/2016</strong>.\r\n<p align="JUSTIFY">Para obter mais informações sobre o procedimento de inscrição para o processo seletivo do curso pré-vestibular, veja o edital no link abaixo.</p>\r\n<p align="JUSTIFY">-&gt; Edital - Processo Seletivo 2016-02</p>\r\n<p align="JUSTIFY">Para demais dúvidas, os interessados podem enviar um e-mail para:  <strong>contato@rumoauniversidade.com.br</strong></p>', 'Processo Seletivo', '', 'inherit', 'closed', 'closed', '', '27-revision-v1', '', '', '2016-07-01 13:51:31', '2016-07-01 16:51:31', '', 27, 'http://rumoauniversidade.ufop.br/?p=54', 0, 'revision', '', 0),
(55, 1, '2016-07-01 13:55:20', '2016-07-01 16:55:20', '<h1><strong>Resultado - </strong><strong>Processo Seletivo do Curso Pré-Vestibular: Rumo à Universidade - 2º Semestre de 2016</strong></h1>\r\nPara os candidatos classificados a matrícula se inicia no dia <strong>26/07/2016 (Terça-feira)</strong> e termina no  dia <strong>27/07/2016 (Quarta- feira)</strong>. Em caso de algum candidato classificado não efetuar a matrícula até o dia final, ele será desclassificado e será chamado o próximo candidato excedente.\r\n\r\nA matrícula poderá ser efetuada das <strong>10:00h</strong> às<strong> 13:30h</strong> no ICEA/UFOP - NACE-JM (Bloco C-1o andar) localizado na Rua Trinta e Seis no 115 – Bairro Loanda.\r\n\r\nDemais informações e lista de classificados, acesso no link abaixo:\r\n\r\n-&gt; <a href="http://rumoauniversidade.ufop.br/wp-content/uploads/2016/07/Resultado-Final-2016-02.pdf">Resultado - Processo Seletivo 2016-02</a>', 'Resultado - Processo Seletivo', '', 'private', 'closed', 'closed', '', 'resultado-processo-seletivo', '', '', '2017-02-15 10:24:17', '2017-02-15 12:24:17', '', 0, 'http://rumoauniversidade.ufop.br/?page_id=55', 0, 'page', '', 0),
