(89, 1, '2016-08-04 23:21:32', '2016-08-05 02:21:32', '*** Contact form submission from Rumo à Universidade (http://rumoauniversidade.ufop.br) *** \n\nSeu Nome: Isabella FarIas Batista \rSeu Email: isabellafariasb@gmail.com \rAssunto: Cooperação Acadêmica \rSua mensagem: Boa noite, Sou estudante de Engenharia Civil da UFG, regional Catalão, e gostaria de iniciar um projeto de monitoria e um cursinho pré-vestibular para alunos da rede pública de ensino. Pesquisei iniciativas semelhantes e encontrei vocês. O campus é pequeno e relativamente novo, toda informação e todo auxílio será muito importante. Seria de imensa ajuda entender quais as dificuldades que vocês encontraram e como as enfrentaram; quais os passos que vocês seguiram desde a concepção à completa implementação do projeto; quais as estratégias para a maior eficácia e eficiência do ensino de cada matéria; como o horário é organizado e como acontece a rotatividade de monitores e professores; e ainda como todo o conteúdo é distribuído ao longo do ano e em que vocês se baseiam para a distribuição. Entendo a relevância de projetos de inclusão social e o potencial transformador destes. Eu quero que o serviço prestado seja o melhor possível e de alta produtividade e eu sei que poder contar com a orientação de vocês será fundamental para isso. Agradeço desde já pela atenção, admiro muito o trabalho de vocês. Att. \rIP address: 191.222.201.78\r IP search: http://whatismyipaddress.com/ip/191.222.201.78 \n\nSent from page: ', 'Friday, Aug 5, 2016 by "Isabella FarIas Batista"', '', 'private', 'closed', 'closed', '', 'friday-aug-5-2016-by-isabella-farias-batista', '', '', '2016-08-04 23:21:32', '2016-08-05 02:21:32', '', 0, 'http://rumoauniversidade.ufop.br/?pf_contact=friday-aug-5-2016-by-isabella-farias-batista', 0, 'pf_contact', '', 0),
