(101, 1, '2017-02-14 13:01:30', '2017-02-14 15:01:30', '<h1><strong>Inscrições Abertas para o Processo Seletivo do Curso Pré-Vestibular: Rumo à Universidade - 1º Semestre de 2017</strong></h1>\r\nO Instituto de Ciências Exatas e Aplicadas (ICEA) da Universidade Federal de Ouro Preto (UFOP) com apoio da Pró-Reitoria de Assuntos Acadêmicos e Estudantis e em parceria com a Prefeitura de João Monlevade oferecerá no primeiro semestre de 2017 um curso pré-vestibular gratuito. O Curso oferecerá as disciplinas de Português, Redação, Matemática, Química, Física, Biologia, Geografia e História.\r\n\r\nO <strong>período de inscrições</strong> para o Processo Seletivo do curso Pré-Vestibular Rumo à Universidade será entre os dias <strong>14/02/2017 e</strong><strong> 08/03/2017</strong>. A inscrição ocorrerá somente nos<strong> dias úteis</strong>.\r\n<p align="JUSTIFY">Para obter mais informações sobre o procedimento de inscrição para o processo seletivo do curso pré-vestibular, veja o edital no link abaixo.</p>\r\n<p align="JUSTIFY"><a href="http://rumoauniversidade.ufop.br/wp-content/uploads/2016/07/Edtial-Processo-Seletivo-Alunos-2016-02.pdf">-&gt; Edital - Processo Seletivo 2017-01</a></p>', 'Processo Seletivo', '', 'inherit', 'closed', 'closed', '', '27-revision-v1', '', '', '2017-02-14 13:01:30', '2017-02-14 15:01:30', '', 27, 'http://rumoauniversidade.ufop.br/?p=101', 0, 'revision', '', 0),
